'use strict';
class AccountCommissionsUpdater {
    manager;
    static create(manager) {
        let instance;
        instance = new AccountCommissionsUpdater();
        instance.manager = manager;
        return instance;
    }
    updateAccountCommissions(queueItem) {
        this.manager.processAccountCommissionsCommandQuery(queueItem);
    }
}
module.exports = AccountCommissionsUpdater
